import logo from './logo.svg';
import React from 'react';
import './App.css';
import Header from './components/Header/Header';
import Stories from './components/Stories/Stories';

function App() {
  return (
    <div className="app">
      <header className="header">
        <Header/>
      </header>
      <div className="stories">
          {/* <Stories/> */}
        </div>
      <nav className="menu">
        {/* Здесь будет ваше горизонтальное меню */}
        <ul>
          <li><a href="#fruits">Фрукты</a></li>
          <li><a href="#berries">Ягоды</a></li>
          <li><a href="#milk">Молоко</a></li>
          {/* Другие категории */}
        </ul>
      </nav>
      <div className="products">
        {/* Блоки продуктов */}
        <section id="fruits">
          {/* Секция с фруктами */}
          <h2>Фрукты</h2>
          {/* Список фруктов */}
        </section>
        <section id="berries">
          {/* Секция с ягодами */}
          <h2>Ягоды</h2>
          {/* Список ягод */}
        </section>
        <section id="milk">
          {/* Секция с молоком */}
          <h2>Молоко</h2>
          {/* Список молочных продуктов */}
        </section>
        {/* Другие секции с продуктами */}
      </div>
    </div>
  );
}

export default App;
